// utils/pdfGenerator.js
import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";

pdfMake.vfs = pdfFonts.pdfMake ? pdfFonts.pdfMake.vfs : pdfFonts.vfs;

export const generateServicePDF = (service) => {
  const formatPrice = (amount) =>
    `CRC ${Number(amount || 0).toLocaleString("es-CR", {
      minimumFractionDigits: 2,
    })}`;

  const subtotal = Number(service.total_price || 0);
  const iva = Number((subtotal * 0.13).toFixed(2));
  const total = Number((subtotal + iva).toFixed(2));

  const docDefinition = {
    content: [
      // Logo centrado en la parte superior
      {
        image: "data:image/png;base64,",
        width: 300,
        alignment: "center",
        margin: [0, 0, 0, 10],
      },
      { text: `Número de orden: ${service.order_number}`, style: "header" },
      { text: `Estado: ${service.status_service.name}`, style: "subheader" },

      { text: "Información General", style: "sectionHeader" },
      {
        table: {
          widths: ["auto", "*"],
          body: [
            ["Fecha de ingreso:", `${service.entry_date} a las ${service.entry_time}`],
            ["Taller:", service.workshop.name || "No disponible"],
            ["Vehículo:", `${service.vehicle.plate} - ${service.vehicle.brand} ${service.vehicle.model}`],
            ["Cliente:", `${service.client.name} ${service.client.lastname1}`],
            ["Correo:", service.client.email || "No disponible"],
            ["Identificación:", service.client.identification || "No disponible"],
            ["Teléfono:", service.client.phone || "No disponible"],
            ["Recibido por:", `${service.received_by.name} ${service.received_by.lastname1}`],
            ["Asignado a:", `${service.assigned_to.name} ${service.assigned_to.lastname1}`],
            ["Área:", service.area.name],
          ],
        },
        layout: "lightHorizontalLines",
        margin: [0, 0, 0, 10],
      },

      service.parts && service.parts.length > 0
        ? [
            { text: "Repuestos", style: "sectionHeader" },
            {
              table: {
                widths: ["*", "auto", "auto", "auto"],
                body: [
                  ["Nombre", "Cantidad", "Precio Unitario", "Total"],
                  ...service.parts.map((part) => [
                    part.name || "No especificado",
                    part.amount,
                    formatPrice(part.price),
                    formatPrice(part.amount * part.price),
                  ]),
                ],
              },
              layout: "lightHorizontalLines",
              margin: [0, 0, 0, 10],
            },
          ]
        : [{ text: "No hay repuestos registrados", margin: [0, 5, 0, 10] }],

      service.labors && service.labors.length > 0
        ? [
            { text: "Mano de Obra", style: "sectionHeader" },
            {
              table: {
                widths: ["*", "auto", "auto", "auto"],
                body: [
                  ["Descripción", "Cantidad", "Precio Unitario", "Total"],
                  ...service.labors.map((labor) => [
                    labor.description || "No especificado",
                    labor.amount,
                    formatPrice(labor.price),
                    formatPrice(labor.amount * labor.price),
                  ]),
                ],
              },
              layout: "lightHorizontalLines",
              margin: [0, 0, 0, 10],
            },
          ]
        : [{ text: "No hay mano de obra registrada", margin: [0, 5, 0, 10] }],

        { text: "Detalles Financieros", style: "sectionHeader" },
      {
        table: {
          widths: ["*", "auto"],
          body: [
            ["N° Factura:", service.invoice_number || "No especificado"],
            ["Método de pago:", service.payment_method || "No especificado"],
            ["Subtotal:", { text: formatPrice(subtotal) }],
            ["IVA (13%):", { text: formatPrice(iva) }],
            ["Total:", { text: formatPrice(total), color: "green", bold: true }],
          ],
        },
        layout: "lightHorizontalLines",
        margin: [0, 0, 0, 10],
      },

    ].flat(),

    styles: {
      header: {
        fontSize: 16,
        color: "#1532ba",
        bold: true,
        margin: [0, 10, 0, 5],
        alignment: "center",
      },
      subheader: { fontSize: 12, margin: [0, 0, 0, 10], alignment: "center" },
      sectionHeader: { fontSize: 14, bold: true, margin: [0, 10, 0, 5] },
    },

    defaultStyle: { fontSize: 10 },
  };

  return {
    save: (filename) => pdfMake.createPdf(docDefinition).download(filename),
  };
};
